import { AllProducts } from 'src/components/AllProducts'

const Wrapper = styled.div``

export class HomePage extends PureComponent {
  render() {
    return (
      <Wrapper>
        <AppLayout>
          <AllProducts/>
        </AppLayout>
      </Wrapper>
    )
  }
}

export default HomePage
